package ManishLokesh.Neptune.v2.Orders.ResponseBody;public class OrderCustomerResponse {    private Long id;    private String fullName;    private String mobileNumber;    private String emailId;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getFullName() {        return fullName;    }    public void setFullName(String fullName) {        this.fullName = fullName;    }    public String getMobileNumber() {        return mobileNumber;    }    public void setMobileNumber(String mobileNumber) {        this.mobileNumber = mobileNumber;    }    public String getEmailId() {        return emailId;    }    public void setEmailId(String emailId) {        this.emailId = emailId;    }}